import React from "react";
import {Component} from "react";
import jsondata from "./data.json";


class Homepage extends Component {

      render(){
          return (
            <section>
            <div>
            <h1>Recomended For You</h1>
          {
            jsondata[0].Recomended.map((data,i) => {
            return (
            <img key={i} className={i} onClick={this.props.selected} src={data.cover} style={{"height":"200px","width":"200px"}}/>
            )
            })
           }
           <h1>Your Daily Mix</h1>
          {
            jsondata[1].DailyMix.map((data,i) => {
            return (
            <img key={i} onClick={this.props.selected} className={i+1} src={data.cover} style={{"height":"200px","width":"200px"}}/>
            )
            })
          
           }
           {
             jsondata.map(val=>{
               return (
                 <div>
                 <h1>{val[Object.keys(val)][0].PlaylistName}</h1>
               console.log(val[Object.keys(val)][0].cover)
               </div>
               )
             })
           }
            </div>
            </section>
        )
      }
}

export default Homepage
